import datetime
import time
def get_last_24hours():
    start = datetime.datetime.fromtimestamp(time.time())
    end = start - datetime.timedelta(days=1)
    end = end.strftime("%Y-%m-%d %H")
    end = time.mktime(time.strptime(end, "%Y-%m-%d %H"))
    return int(end), int(time.time())

